webpackJsonp([0xa21f99100b0b],{638:function(e,t){e.exports={data:{markdownRemark:{html:'<p>All vulnerability reports submitted to your program are sent directly to the inbox where you can view and manage your reports.</p>\n<p>The inbox is comprised of:</p>\n<ul>\n<li><a href="inbox-views.html">Inbox views</a></li>\n<li>Filters</li>\n<li>Search</li>\n<li><a href="response-labels.html">Labels</a></li>\n</ul>\n<p>You can customize your filters and views to better fit the workflow for your program.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/inbox-60d098ff7e71eef454e6bd859f5a911b-85c10.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 39.404869251578%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="inbox"\n        title=""\n        src="/static/inbox-60d098ff7e71eef454e6bd859f5a911b-e7ffa.png"\n        srcset="/static/inbox-60d098ff7e71eef454e6bd859f5a911b-49813.png 125w,\n/static/inbox-60d098ff7e71eef454e6bd859f5a911b-dc8a5.png 250w,\n/static/inbox-60d098ff7e71eef454e6bd859f5a911b-e7ffa.png 500w,\n/static/inbox-60d098ff7e71eef454e6bd859f5a911b-dda24.png 750w,\n/static/inbox-60d098ff7e71eef454e6bd859f5a911b-c5f18.png 1000w,\n/static/inbox-60d098ff7e71eef454e6bd859f5a911b-22484.png 1500w,\n/static/inbox-60d098ff7e71eef454e6bd859f5a911b-85c10.png 2218w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Navigating your Inbox</h3>\n<p>To navigate through your inbox:</p>\n<ol>\n<li>Click <b>Inbox</b> in your navigation header to access your inbox.</li>\n<li>Search for your reports by the:</li>\n</ol>\n<table>\n<thead>\n<tr>\n<th>Item</th>\n<th>Description</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Search bar</td>\n<td>Type the name or keywords of a report to search for relevant reports.</td>\n</tr>\n<tr>\n<td>Filters</td>\n<td>Click \n<b>\nShow filters\n</b>\n to view the different options you can select to filter your reports by.</td>\n</tr>\n<tr>\n<td><a href="inbox-views.html">Inbox Views</a></td>\n<td>Saved filters that categorize your inbox reports.</td>\n</tr>\n</tbody>\n</table>\n<ol start="3">\n<li>Click the report you want to view .</li>\n<li><a href="report-actions.html">Take action</a> on the report.</li>\n</ol>\n<p>There are <a href="keyboard-shortcuts.html">keyboard shortcuts</a> that you can use to help you quickly navigate through your reports in the inbox. </p>',frontmatter:{path:"/programs/inbox.html",id:"programs/parent-child-programs",title:"Inbox",description:null}}},pathContext:{}}}});
